      <React.StrictMode>
        <div>
          <TITLE>Products</TITLE>
          <ul id="product-list">
            <li>
              <img src="../Images/item1" alt="" />
              <p>プロダクトタイトルプロダクトタイトル</p>
              <p>¥99,999 +tax</p>
            </li>
          </ul>
        </div>
      </React.StrictMode>
    );
  }
}

const TITLE = styled.h1`
  font-size: 14px;
  font-weight: normal;
`;

export default Products;
